import React from 'react';

class Edu1Front extends React.Component {
    handleClick = () => {
        alert: 'alert'
    }
    render() {
        return (
            <div id='edu1' className='tc dib br3 pa3 ma2 bw2 shadow-5'>
                <p>January '14 - December '16</p>
                <p>3 years</p>
                <p>________________________________________</p>
                <h6>Masters Degree (M.Sc.)</h6>
                <h6>Physiological Sciences</h6>
                <p>________________________________________</p>
                <p>Stellenbosch University</p>
                <button onClick={this.handleClick()} className='pointer'>Click to flip</button>
            </div>
        );
    }
}

export default Edu1Front;
